INSERT INTO `sys_logs` VALUES ('1534162933603442690', '【修改】酒店信息', '{\"id\":\"1514824528872632321\",\"deptId\":\"1514820152590340098\",\"name\":\"SixOneFour国际度假酒店\",\"province\":\"广东省\",\"city\":\"广州市\",\"address\":\"广东省广州市大学城南(地铁站)\",\"parkingLot\":\"电动车停车位\",\"longitude\":\"110.345154\",\"latitude\":\"21.268762\",\"introduce\":\"\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e1.8米运动场景大床房，亲切的贴着大玻璃落地窗，使我们更近距离的感受一望无际的大海；清晨从美梦中醒苏醒第一眼感受碧海蓝天大自然的馈赠，就如童年的梦就在眼前，这也许就是我们每个人心灵中所向往的一道风景吧\\u0026hellip;\\u0026hellip;傍晚时刻独享一天中所求浪漫【夕阳之美】； 小主人是室内设计师，设计出独特的风格，使得我们无论从哪个角度，都能照出美妙的照片，空间营造轻松的居住氛围，让朋友们可以卸下旅途中的疲惫，让心灵慵懒地渡过美好假期！\\u003c/p\\u003e\",\"facilities\":\"\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e?\\u0026nbsp; 停车场\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u003cstrong\\u003e有\\u003cspan style\\u003d\\\"text-decoration: underline;\\\"\\u003e免费\\u003c/span\\u003e停车场\\u003c/strong\\u003e\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left; padding-left: 40px;\\\"\\u003e酒店附近提供私人停车场,无需预订\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left; padding-left: 40px;\\\"\\u003e步行约100-200米到达酒店大堂\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left; padding-left: 40px;\\\"\\u003e共60个车位(车位信息仅供参考,具体以实际为准)\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u003cstrong\\u003e无充电车位\\u003c/strong\\u003e\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u0026nbsp;\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u003cstrong\\u003e?\\u003c/strong\\u003e 网络\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e公用区WIFI免费\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u0026nbsp;\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e?\\u0026nbsp; 淋浴设施\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e有花洒 | 24小时热水直供 | 一次性洗浴用具\\u003c/p\\u003e\",\"allowIsolation\":1,\"isDeleted\":0,\"otherPolicy\":\"\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e⏰ \\u0026nbsp;入离时间\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e入住时间: 14:00以后\\u0026nbsp;\\u0026nbsp; \\u0026nbsp; \\u0026nbsp;离店时间:12:00以前\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u0026nbsp;\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e?\\u0026nbsp; 儿童及加床\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e酒店允许携带儿童入住。\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e1岁及以上客人按成人收费。\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u003cstrong\\u003e床铺\\u003c/strong\\u003e\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e每间客房最多容纳1名1岁以下儿童，和成人共用现有床铺。\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u0026nbsp;\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e?\\u0026nbsp; 宠物\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e不可携带宠物\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u0026nbsp;\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e?\\u0026nbsp; 早餐\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e酒店不提供早餐\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e\\u0026nbsp;\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e?\\u0026nbsp; 年龄限制\\u003c/p\\u003e\\n\\u003cp style\\u003d\\\"text-align: left;\\\"\\u003e入住办理人需年满18岁\\u003c/p\\u003e\",\"cover\":\"http://hotelsystem.top/hotel_cover_1654603457611\",\"sort\":2,\"createBy\":\"1\",\"createTime\":\"Apr 13, 2022 11:23:54 PM\",\"updateBy\":\"1\",\"updateTime\":\"Jun 7, 2022 8:04:19 PM\"}@*@{\"id\":\"1514824528872632321\",\"deptId\":\"1514820152590340098\",\"name\":\"SixOneFour国际度假酒店\",\"address\":\"广东省广州市大学城南(地铁站)\",\"parkingLot\":\"电动车停车位\",\"allowIsolation\":1,\"otherPolicy\":\"\",\"cover\":\"http://hotelsystem.top/hotel_cover_1